                        color: "black"  
                    }}
                    onClick={() =>
                        onCount()
                      }

                    variant="contained">
                    <p color="#fffff"> {user}</p>  

                    </Button>


            </Grid>

            <Divider />

        </Grid>
    )
}

export default UserItem;
